text = {
	["Default"] = { name = "-", desc = "Bộ sơn không tên" },
	["so_yellow"] = { name = "Bulldozer", desc = "Từng phần được phun riêng một màu sơn theo tông vàng.\n\nThứ phá xương này là thứ hủy diệt" },
	["so_olive"] = { name = "Groundwater", desc = "Từng phần được phun riêng một màu sơn theo tông nâu ô liu." },
	["so_red"] = { name = "Candy Apple", desc = "Từng phần được phun riêng một màu sơn theo tông đỏ và đen.\n\nNhìn ngon lên xe, còn hơn nữa trên súng" },
	["so_purple"] = { name = "Ultraviolet", desc = "Từng phần được phun riêng một màu theo tông đen và tím.\n\nThiết kế tao nhã đi kèm ý định tàn bạo" },
	["so_night"] = { name = "Night", desc = "Từng phần được phun riêng một màu theo tông màu chiến dịch đêm.\n\nLà lời thì thầm trong gió... là nhát cắn vào cổ ai" },
	["so_caramel"] = { name = "Caramen", desc = "Từng phần được phun riêng một màu sơn theo tông caramen và đen." },
	["so_grassland"] = { name = "Grassland", desc = "Từng phần được phun riêng một màu sơn theo tông màu đất cỏ." },
	["so_moss"] = { name = "Blue Spruce", desc = "Từng phần được phun riêng một màu sơn theo tông màu rêu." },
	["so_sand"] = { name = "Sand Dune", desc = "Từng phần được phun riêng một màu sơn theo tông màu cát.\n\nGiờ khi mà Turner đã chết, chúng ta cần ưu tiên cái mới: giải cứu Alex Kincaide - Sĩ quan chỉ huy Felix Riley" },
	["so_stormfront"] = { name = "Storm", desc = "Từng phần được phun riêng riêng một màu sơn theo tông màu bão.\n\nSẽ chờ người nơi đường một ray" },
	["so_tornado"] = { name = "Tornado", desc = "Từng phần được phun riêng một màu sơn theo tông màu bão lốc." },
	["so_whiteout"] = { name = "Whiteout", desc = "Toàn bộ được phủ một lớp sơn trắng.\n\nTrông thì có vẻ thuần khiết, nhưng đừng nhìn mặt mà bắt hình dong" },
	["so_jungle"] = { name = "Jungle", desc = "Từng phần được phun riêng một màu sơn theo tông màu rừng già." },
	["so_space_marine"] = { name = "Colony", desc = "Từng phần được phun riêng một màu kaki và xám." },
	["so_pmc"] = { name = "Contractor", desc = "Từng phần được phun riêng một màu theo tông nâu sạm, hải quân và xanh lục tối.\n\nRona Sabri vẫn chưa tha cho Sebastien vì đã không chọn cô để truy lùng Turner" },
	["so_tangerine"] = { name = "Demolition", desc = "Từng phần được phun riêng một màu sơn theo tông đen và quýt.\n\nRona có thực lực y như bản thân cô ta nghĩ... chỉ là còn quá non để tự biết không khoe nó cho tất cả mọi người - Sĩ quan chỉ huy Felix Riley" },
