	["hy_dive"] = { name = "Dive Camo", desc = "Được sơn nhúng họa tiết ngụy trang xanh lam.\n\nỞ thế giới này thì luôn cần kín đáo...nhưng đôi khi ngụy trang là để được phơi bày - Tay buôn vũ khí Booth" },
