	["hy_skulls"] = { name = "Skulls", desc = "Được sơn nhúng sử dụng họa tiết đầu lâu theo tông màu đỏ hoặc đen.\n\nMộ tập thể ngay trong lòng bàn tay của bạn" },
	["hy_webs"] = { name = "Crimson Web", desc = "Được sơn nhúng sử dụng họa tiết tơ nhện phủ trên lớp sơn đỏ nền và lớp nhũ bán bóng phủ lên trên cùng.\n\nBước cho cẩn thận, chẳng thể biết mạng nhện được giăng tới đâu" },
