	["an_silver"] = { name = "Silver", desc = "Được sơn một lớp nền crôm rồi phủ lên hiệu ứng anode màu bạc trong suốt.\n\nSự đơn điệu có cái đẹp của nó - Chiến thuật gia tổ chức Phoenix, Franz Kriegeld" },
	["an_red"] = { name = "Hot Rod", desc = "Được sơn với màu nền crôm rồi phủ lên hiệu ứng anode đỏ trong suốt.\n\nTự động. Hệ thống. Thủy lực." },
	["an_gunmetal"] = { name = "Anodized Gunmetal", desc = "an_gunmetal" },
	["an_navy"] = { name = "Anodized Navy", desc = "Được sơn một lớp nền crôm rồi phủ lên hiệu ứng anode màu lam hải quân trong suốt." },
	["am_urban"] = { name = "Metallic DDPAT", desc = "Được sơn nhúng sử dụng họa tiết ngắt quãng điện tử (DDPAT) lên trên lớp nền kim loại." },
	["am_tiger"] = { name = "Gold Tiger", desc = "Được mạ vàng rồi khắc tay họa tiết vằn hổ." },
	["am_dragon_glock"] = { name = "Dragon Tattoo", desc = "Được sơn với đề can hình rồng bên trên lớp phủ kim loại.\n\nHiệp sĩ luôn chiến thắng con rồng trong truyện cổ tích... nhưng đây là thực tế - Valeria Jenner, Cách mạng" },
	["am_caustics"] = { name = "Caustics", desc = "Được sơn nhúng nước với màu đỏ và trắng lên trên lớp nền kim loại cacbon." },
	["am_lightning_awp"] = { name = "Lightning Strike", desc = "Được sơn theo mô típ sét đánh sử dụng sơn hiệu ứng anode lên trên một lớp nền kim loại.\n\nĐôi khi không cần giáng đến đòn thứ hai" },
	["am_ossify"] = { name = "Ossified", desc = "Được sơn nhúng sử dụng sơn màu xanh chanh trừu tượng trong suốt lên trên lớp nền kim loại." },
	["aa_flames"] = { name = "Blaze", desc = "Được xịt bằng airbrush màu trong suốt lên trên lớp nền crôm." },
	["aa_splash_p250"] = { name = "Splash", desc = "Được xịt màu sơn trong suốt bằng airbrush qua khung tô lên trên lớp nền crôm." },
	["aa_fade"] = { name = "Fade", desc = "Được xịt màu sơn trong suốt bằng airbrush, rồi để phai lẫn vào nhau, bên ngoài lớp phủ crôm gốc.\n\nKhông đơn thuần một vũ khí, nó là công cụ hội thoại - Tay buôn vũ khí tập sự Imogen" },
	["aa_fade_metallic"] = { name = "Amber Fade", desc = "aa_fade_metallic" },
	["aa_fade_grassland"] = { name = "Acid Fade", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Copper", desc = "Được mạ đồng." },
	["aq_blued"] = { name = "Blue Steel", desc = "Được nhuộm xanh nguội.\n\nĐây như chai malbec của ngành thiết kế vũ khí - Tay buôn vũ khí Booth" },
	["aq_forced"] = { name = "Stained", desc = "Được làm gỉ nhân tạo bằng cách nhỏ chanh và mù tạt lên bề mặt.\n\nBình thường trông đã nhem nhuốc, nhưng thử xoi nó dưới ánh đèn UV xem" },
	["aq_oiled"] = { name = "Case Hardened", desc = "Được tôi luyện màu vỏ dựa trên ứng dụng tiếp xúc với than củi ở nhiệt độ cao.\n\nMàu mè chút chả chết ai" },
	["sp_spitfire_famas"] = { name = "Spitfire", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Slaughter", desc = "Được sơn họa tiết ngựa vằn bằng nhôm, crôm và một vài chất phản quang khác, rồi phủ lên một lớp màu kẹo đỏ cà chua.\n\nValeria không thuê Javier để đặt mấy câu hỏi... mà là đi moi ra câu trả lời" },
	["am_zebra_dark"] = { name = "Dark Water", desc = "Được phủ họa tiết sọc biển bằng sơn kim loại chì phản quang lên trên lớp nền crôm.\n\nNước ban sự sống, nhưng cũng có thể lấy đi..." },
	["aa_vertigo"] = { name = "Hypnotic", desc = "Được phủ lớp nền màu ngọc trai, rồi sơn họa tiết đen qua khung tô.\n\nKhông phải cơn buồn ngủ đâu, mà là dần ngất lịm đi do mất máu" },
	["cu_spring_nova"] = { name = "Bloomstick", desc = "Được sơn bằng tay sử dụng airbrush theo mô típ hoa anh đào, rồi phủ lên trên lớp bóng cao." },
	["sp_hazard"] = { name = "Hazard", desc = "sp_hazard" },
	["aq_rust"] = { name = "Rusty", desc = "Mặc dù bề mặt ngoài bị rỉ, vũ khí này vẫn hoạt động hoàn toàn trơn tru." },
	["am_slither_p90"] = { name = "Cold Blooded", desc = "Được sơn một lớp nền crôm và phủ hiệu ứng anode đỏ trong suốt. Rồi được khắc bằng laser theo mô típ rắn trườn bò." },
	["am_carbon_fiber"] = { name = "Carbon Fiber", desc = "Được phun sơn họa tiết sợi carbon lên trên lớp nền than chì.\n\nChỉ vì tôi gánh hết mọi người, không có nghĩa đấy không phải công sức cả đội - Rona Sabri, Ngôi sao đang lên" },
	["am_scorpion_p2000"] = { name = "Scorpion", desc = "Được sơn họa tiết gợn sóng màu phai bằng hiệu ứng anode cùng với đề can bọ cạp ở tay cầm." },
	["hy_feathers_aug"] = { name = "Wings", desc = "Được trang trí sử dụng các miếng dán khô họa tiết lông đại bàng.\n\nĐại bàng trông uy nghiêm, cho tới khi nó móc mắt ngươi ra" },
