	["am_metal_inlay"] = { name = "Dark Age", desc = "Được chải sơn kim loại cho giống như là đã khảm kim loại theo mô típ trung cổ.\n\nTa có thể khử người tình của cô ta... có lẽ sẽ mua được chút thời gian với Valeria - Tình thương của cha, phần 2" },
