	["so_indigo"] = { name = "Royal Blue", desc = "Được sơn riêng từng màu chàm, đỏ thẫm và xám.\n\nCười lên đi Felix, ông sẽ có nhiều cơ hội hơn với mấy chị em nếu không trông như một tên khốn khắc khổ mãi vậy - Tay buôn vũ khí tập sự Imogen" },
	["so_indigo_and_grey"] = { name = "Indigo", desc = "Được sơn riêng từng màu chàm, lam và xám.\n\nAlex Kincaide, tôi chắc là giờ anh có nhiều thắc mắc... hãy cho phép tôi được trả lời - Phượng hoàng và người kể chuyện, phần 1" },
	["cu_well_traveled_ak47"] = { name = "Jet Set", desc = "Báng súng được bọc da nâu. Vũ khí này đã chu du đến nhiều nơi.\n\nChỉ cần ai để ý kĩ sẽ tự nối mảnh ghép lại và nhìn ra cô ta đã làm gì. Chúng ta không còn nhiều thời gian để tìm biện pháp... - Tình thương của cha, phần 1" },
