	["aq_Desert_Eagle_Constable"] = { name = "Directive", desc = "Được thiết kế để giúp thế hệ tương lai của lực lượng thi hành pháp ngăn chặn lũ biến thái.\n\nĐến phiên ngươi..." },
	["gs_FAMAS_Rally"] = { name = "Roll Cage", desc = "Được dán đề can hàng độ có họa tiết trông như khung sườn một chiếc xe bám bùn.\n\nAn toàn là trên hết" },
	["aq_Five_Seven_Scumbria"] = { name = "Scumbria", desc = "Được sơn các sọc tách rời.\n\nKhông thể để ông ấy chết như vậy, Felix; ông phải cứu ông ấy - Cô con gái và hiệp sĩ, phần 1" },
	["gs_G3SG1_Ventilator"] = { name = "Ventilator", desc = "Được sơn crôm và màu đen tao nhã và thay báng bằng cao su.\n\nYên tâm đi Naomi, tôi sẽ bắt Felix trả giá - Tay bắn tỉa tổ chức Phoenix, Mikha Biton" },
	["cu_Glock18_Weasel"] = { name = "Weasel", desc = "Được sơn nhúng hình chú chồn tinh nghịch Bobby. Đừng nhây với Bobby.\n\nChỉ vì chú ta dễ thương, không có nghĩa là không biết cắn" },
	["cu_MAG7_Tribal"] = { name = "Petroglyph", desc = "Được sơn tùy chỉnh để gây ảo giác như một bức chạm khắc trên đá.\n\nMâu thuẫn đã tồn tại ngay từ khi người thượng cổ đầu tiên học cách cầm viên đá lên – Tay buôn vũ khí Booth" },
	["cu_MP9_Narcis"] = { name = "Airlock", desc = "Được sơn trắng và lắp băng đạn màu đỏ nổi bật.\n\nThích hợp để bắn máy nướng bánh" },
	["hy_Negev_Dazzle"] = { name = "Dazzle", desc = "Được dán phủ bằng đề can sọc ngựa vằn lam và trắng.\n\nMãi mới thấy, một khẩu súng cho người ưa tiểu tiết" },
	["cu_P90_Grimm"] = { name = "Grim", desc = "Dùng kỹ thuật sơn nhúng để in hình các bóng ma sát nhân, rồi sơn khô tô điểm làm bật màu xanh lá.\n\nImogen... cô đang bán tôi súng hay áp phích nhung vậy? – Rona Sabri, Ngôi sao đang lên" },
	["gs_SCAR20_Powercore"] = { name = "Powercore", desc = "Được sơn riêng bằng màu lục với chút vàng điểm xuyến, và in mã vạch để tiện thanh toán.\n\nĐiều số 1 – Thách đấu: đòi phải được thỏa đáp" },
	["cu_SG556_Triarch"] = { name = "Triarch", desc = "Khẩu súng được đặt làm bởi hoàng thất và chỉnh họa tiết ngụy trang sa mạc.\n\nNhắc họ nhớ về tình yêu của mình" },
	["gs_TEC9_Supercharged"] = { name = "Fuel Injector", desc = "Thân súng được chải màu vàng kèm theo băng đạn với kỹ thuật sơn nước để in hình dây chuyền động cơ. Cán súng phủ bằng da thêu thủ công là điểm nhấn hoàn thiện cho khẩu súng Seattle cổ điển này.\n\nKhông đi kèm đội kĩ thuật" },
	["cu_UMP45_Metritera"] = { name = "Briefing", desc = "Được sơn nhúng hình bản đồ đo vẽ địa hình.\n\nĐây sẽ là cuộc họp ngắn thôi..." },
	["hy_XM1014_Fractal_Blue"] = { name = "Slipstream", desc = "Được sơn tùy chỉnh các màu xám khói và lam sặc sỡ.\n\nBình tĩnh, Elliott; vẫn còn vai cho chúng... - Lính đánh thuê và con mãng xà, phần 2" },
	["am_czv2_mf"] = { name = "Polymer", desc = "Phần thanh trượt được dán đề can trông giống công thức polime.\n\nCô không phải đối phó với Phoenix nữa, bọn tôi biết lo cho người của mình... - Cô con gái và hiệp sĩ, phần 2" },
	["aq_glock_dark-fall"] = { name = "Ironwork", desc = "Phần thanh trượt được khắc laser vẽ tường vi và những lưỡi gai.\n\nĐể mặc đi, khu vườn nào cũng sẽ thành một mớ cỏ hỗn độn" },
	["cu_ssg08_dragonfire_scope"] = { name = "Dragonfire", desc = "Được sơn nhúng hình một con rồng quái dị phun lửa.\n\nNgồi trên đống của cải, chờ kẻ nào dám đến lấy đi" },
	["gs_dual_berettas_golden_venice"] = { name = "Royal Consorts", desc = "Giữa chỗ tay cầm nạm ngọc trai nhuộm xanh lục, là tấm kim loại nạm hình sư tử đầu chim, và thanh trượt khắc bằng laser; đôi súng này định nghĩa lại khái niệm tao nhã.\n\nĐổi mặt và thả lũ bồ câu" },
	["gs_famas_mecha"] = { name = "Mecha Industries", desc = "Thiết kế trắng đục và đen đậm khiến nó cứ như hàng trong phim khoa học viễn tưởng.\n\nKhông đi kèm tóc dựng màu xanh và bạn đồng hành người máy" },
	["gs_final_pooldeadv2"] = { name = "Cirrus", desc = "Được sơn màu lam kim loại và dán đề can đầu lâu.\n\nNgừng sống trên mây ngay, xuống mặt đất cho con nhờ" },
