	["am_mag7_malform"] = { name = "Sonar", desc = "Được sơn khuôn tô hơi màu ngọc lam.\n\nCô nói phải, với tôi thua cuộc là trải nghiệm mới – Quỷ Oni và Valkyrie, phần 2" },
