	["gs_p2000-sport"] = { name = "Turf", desc = "Phần tay cầm và thanh trượt được sơn màu xanh lục ánh kim.\n\nCỏ luôn đỏ hơn ở phía đối diện" },
	["gs_p90_shallow_grave"] = { name = "Shallow Grave", desc = "Tay cầm được sơn để trông giống đá cổ tự, và dùng kỹ thuật sơn nhúng nước để in hình bộ xương lên báng súng.\n\nXem cái lượng xác mi đang tống vào mồ kìa, ai có thời gian mà đào chứ?" },
