	["cu_ak-47_phantom_disruptor"] = { name = "Phantom Disruptor", desc = "Một sinh vật ảo ảnh tựa sương mù được sơn tùy chỉnh trên nền đen nhám.\n\n\"Nó có thể trở thành bất cứ hình dạng gì, đến bất cứ nơi đâu nó muốn, vậy mà nó lại chọn ở bên bạn…\"" },
	["gs_aug_thunderstorm"] = { name = "Tom Cat", desc = "Lớp nền xám đen được hoàn thiện với điểm nhấn màu vàng kim khí, những mũi tên hướng về phía sau, và một con mèo tinh quái.\n\nDông là tiếng rên gừ gừ của thiên nhiên" },
	["cu_awp_vein"] = { name = "Capillary", desc = "Một kiểu sơn tùy biến kết hợp giữa các mạch màu mòng két và san hô.\n\nPhí chìa khóa tới con tim: $4750" },
	["cu_cz75_cerakote"] = { name = "Distressed", desc = "Lớp phủ bằng gốm màu đồng này đang bị mòn dần qua quá trình sử dụng.\n\nCàng lão càng tinh" },
	["cu_deagle_replica"] = { name = "Blue Ply", desc = "Được cán mỏng và phủ sơn tay cầm xám với thanh trượt phủ xanh.\n\nCẢNH BÁO: Hàng cờ nhôn đam mê, chưa kiểm duyệt với đạn thật" },
	["cu_m4a1s_csgo2048"] = { name = "Player Two", desc = "Được sơn tùy chỉnh với màu sắc tươi sáng và hình ảnh đặc nhiệm chống khủng bố GIGN và Pop Dog theo phong cách hoạt hình.\n\nPress Start..." },
