	["cu_negev_ultralight"] = { name = "Ultralight", desc = "Được sơn tùy chỉnh với họa tiết ngụy trang kỹ thuật số màu xám và mũi tên màu xanh mòng két.\n\nCó đèn chưa?" },
	["cu_ak47_anubis"] = { name = "Legion of Anubis", desc = "Nước sơn tùy chỉnh được sử dụng mang hình ảnh của các vị thần Ai Cập Anubis và Ra, tượng trưng cho sự cân bằng giữa sự sống và cái chết.\n\nMong cán cân của ngài có lợi cho ngươi" },
	["aq_p2000_lost_world"] = { name = "Gnarled", desc = "Một sinh vật ngoài hành tinh trải từ tay cầm đến hộp khóa nòng của chiếc P2000 được sơn thủ công này.\n\nTừ những góc tối của khoảng không vô tận" },
	["cu_mag7_monster_call"] = { name = "Monster Call", desc = "Được sơn tùy chỉnh với nền xanh và những sinh vật dưới nước ở phía trước.\n\nSẽ luôn có những con cá lớn hơn, nhưng gà hơn" },
	["cu_printstream"] = { name = "Printstream", desc = "Được sơn tùy chỉnh với thiết kế đen trắng rõ ràng và được hoàn thiện cùng những điểm nổi bật như màu ngọc trai.\n\nTRẮNG_1; ĐEN_1; NGỌC TRAI_1;" },
	["cu_glock_eyecontact"] = { name = "Vogue", desc = "Một đôi mắt duyên dáng được sơn tùy chỉnh trên hộp khóa nòng của khẩu Glock, lấy cảm hứng từ nghệ thuật đại chúng.\n\n\"Nhìn vào em khi em đang khai hỏa này!\"" },
	["gs_tec9_guerilla"] = { name = "Brother", desc = "It has been custom painted with a brown and gold camo pattern and a T-sided agent beneath the rear sight.\n\nI'll watch our butts" },
	["cu_mac10_isoonna"] = { name = "Allure", desc = "Một người phụ nữ trong bộ đồ màu mòng két, được cho là Iso onna, đứng trước cá koi và sóng vỗ trên khẩu MAC-10 này.\n\nĐẹp đến đổ máu" },
