	["cu_m4a4_queenfairy"] = { name = "Tooth Fairy", desc = "Nước sơn tùy chỉnh được sử dụng có các họa tiết răng cửa, răng hàm và hình mô tả Tiên Răng phong cách rùng rợn.\n\nChẳng ai nói rằng răng phải là của ngươi cả…" },
	["gs_galil_phoenix"] = { name = "Connexion", desc = "Logo băng đảng Phoenix đã được sơn xịt lên nền súng trắng và đỏ.\n\nTụi nó mang hàng khủng ra đó" },
