	["gs_ump_gold_bismuth"] = { name = "Gold Bismuth", desc = "Hoa văn đá bitmut vàng ròng được kẹp giữa hai lớp sơn nền đen và trắng.\n\n\"Sở thích đắt đỏ quá ha…\"" },
	["cu_usp_krokos"] = { name = "Monster Mashup", desc = "Được sơn tùy chỉnh với quái vật xanh lá và các biểu tượng khác lấy cảm hứng từ các ảnh đường phố nổi đình đám. Phần hãm thanh được sơn hoàn thiện với ngũ sẵc sáng.\n\nX__X" },
