	["gs_revolver_purple_elite"] = { name = "Crazy 8", desc = "Được sơn tùy biến với ống súng màu tím và số 8 trên tay cầm.\n\nLấy cảm hứng từ sự kiện vào 8 tháng 12, 2015" },
	["gs_famas_corp_meow"] = { name = "Meow 36", desc = "Nền xanh lá cây tô điểm thêm số 36.\n\nVề kỹ thuật mà nói thì đó là bốn con mèo, nhưng có ai đếm đâu?" },
	["cu_galil_destroyer"] = { name = "Destroyer", desc = "Được sơn tùy biến với chữ \"DESTROYER\", nhưng phải nhìn đúng góc mới thấy.\n\nPhá hủy tất cả chúng nó" },
	["cu_m249_downvote"] = { name = "Downtown", desc = "Được gắn các mũi tên màu xanh dương và hồng chỉ khắp mọi hướng.\n\nMột kiểu sơn phun rất khác" },
	["cu_m4a4_elite_tactical"] = { name = "Poly Mag", desc = "Được sơn tùy biến với một hộp tiếp đạn màu polymer trong suốt, màu rám nắng trên báng súng, tay cầm, ốp lót tay và chuôi.\n\nQuy trình vận hành tiêu chuẩn" },
	["cu_mac10_monkeyflage"] = { name = "Monkeyflage", desc = "Khỉ đỏ, khỉ nâu, khỉ xanh lá điểm tô cho khẩu MAC-10 này.\n\nNhư khỉ làm trò!" },
	["cu_sg553_cyber_dragon"] = { name = "Dragon Tech", desc = "Được sơn tùy biến với hình rồng cơ sinh học màu xanh lá.\n\nHổng phải rồng của em…" },
	["cu_negev_clear_sky"] = { name = "Drop Me", desc = "Một biển báo Stop được sơn tùy biến trên nền màu nâu gần báng súng.\n\nKhi biển báo dừng không đủ sức thuyết phục, thì mưa đạn đây sẽ đảm nhận thay" },
	["gs_p250_visions"] = { name = "Visions", desc = "Được sơn tùy biến với thiết kế màu sắc sặc sỡ.\n\nThiếu quạ nên không thể trả vàng" },
	["gs_p90_tangled"] = { name = "Vent Rush", desc = "Được sơn tùy biến để biến khẩu P90 như đan xen với băng gaffer, dây ống, và lửa.\n\n\"Em có biết đã phóng vận tốc bao nhiêu hông?\"" },
	["cu_sawedoff_kisslove"] = { name = "Kiss♥Love", desc = "Được sơn tùy biến hình một cô gái mắt ngôi sao màu hồng và tím.\n\n\"Em ứ chịu nghe từ chối đâu; không có không chịu về!\"" },
	["cu_dual_elites_evil_flora"] = { name = "Flora Carnivora", desc = "Ba cây hoa ăn thịt háu đói, sáng màu rực rỡ được sơn lên trên mỗi khẩu của cặp Beretta.\n\nGiúp nuôi chúng lớn và mạnh" },
	["gs_ump_roadblock"] = { name = "Roadblock", desc = "Được sơn tùy biến với các vạch màu cam cùng mũi tên hướng về phía trước.\n\nTìm các đường thay thế" },
