	["sp_spray_waves_bravo"] = { name = "sp_spray_waves_bravo", desc = "Kỉ vật từ Seaside này được phun sơn tay không các đường nét ngắn, đậm theo nhiều màu tương phản.\n\nRất phù hợp để chuẩn bị nổi dậy bất cứ lúc nào" },
	["hy_ocean_bravo"] = { name = "hy_ocean_bravo", desc = "Kỉ vật từ Seaside này được sơn nhúng sử dụng họa tiết ngụy trang lam.\n\n Thế giới này luôn mưu mô lừa lọc...nhưng đôi khi lớp vỏ ngụy trang lại là để được lộ diện - Tay buôn vũ khí Booth" },
	["sp_spitfire_famas_bravo"] = { name = "sp_spitfire_famas_bravo", desc = "Kỉ vật từ Cache này được sơn hình miệng cá mập theo mô típ mũi máy bay.\n\nJester xong rồi" },
	["hy_tile_bravo"] = { name = "hy_tile_bravo", desc = "Kỉ vật từ Ali này được sơn nhúng họa tiết đồ khảm.\n\nKiên nhẫn là một đức tính" },
	["an_navy_bravo"] = { name = "an_navy_bravo", desc = "Kỉ vật từ Ali này được sơn lớp crôm rồi phủ màu hiệu ứng anode hải quân trong suốt.\n\nTin lời của Valaria đã hại chết người của tôi... tôi nhất quyết không định sẽ để mất thêm ai nữa - Sĩ quan chỉ huy Felix Riley" },
	["sp_hazard_bravo"] = { name = "sp_hazard_bravo", desc = "Kỉ vật từ Siege này được phun sơn họa tiết sọc cảnh báo nguy hiểm.\n\nCẤM ĐI VÀO" },
	["sp_tape_dots_bravo"] = { name = "sp_tape_dots_bravo", desc = "Kỉ vật từ Gwalior này được phun sơn sử dụng các mảnh băng dán và kim loại khoét lỗ làm khuôn tô.\n\nKhỏi lo...việc làm ăn sẽ khá ngay thôi - Tay buôn vũ khí Booth" },
	["hy_ddpat_bravo"] = { name = "hy_ddpat_bravo", desc = "Kỉ vật từ Ruins này được sơn nhúng sử dụng họa tiết ngắt quãng điện tử (DDPAT).\n\nTuy không nhìn ra nó, nhưng chắc chắn có thể nghe thấy được" },
	["so_jungle_bravo"] = { name = "so_jungle_bravo", desc = "Kỉ vật từ Ruins này có từng phần phun riêng một màu sơn theo tông màu rừng già.\n\nCho những ai ưa phá hủy" },
	["so_tornado_bravo"] = { name = "so_tornado_bravo", desc = "Kỉ vật từ Ali này được phun từng phần riêng một màu sơn theo tông màu bão lốc.\n\nLời nói gió bay, nhưng gió có khi lại chết người" },
	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "Kỉ vật từ Gwalior này được phun từng phần riêng một màu sơn theo tông màu cồn cát.\n\nPhóng viên thực nghiệm Alex Kincaide bị mất tích sau khi đi tới Maghreb để theo dõi chiến dịch Vanguard" },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "Kỉ vật từ Cache này được phun từng phần riêng một màu sơn theo tông màu nâu ô liu.\n\nĐừng bao giờ cho rằng chiến thắng là hiển nhiên" },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Kỉ vật từ Siege này được sơn hiệu ứng anode thép súng lên trên lớp nền crôm.\n\nKhông ai biết rõ Felix Riley như tôi đâu... chẳng gì có thể làm ông ta gục ngã -\n Tên phản bội và kẻ lần sự thật, phần 1" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "Kỉ vật từ Seaside này được sơn nhúng trừu tượng sử dụng màu lam trong suốt lên trên lớp nền kim loại.\n\nSóng vỡ, quyết tâm này không thể - Chuyên gia thâm nhập Kotaro Izaki" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "Kỉ vật này từ vụ Agency được sơn nhúng họa tiết đa giác bằng sơn ánh kim chứa nhiều chất phản quang lên trên lớp nền crôm.\n\nĐặt bút xuống, giơ tay lên" },
	["aq_steel"] = { name = "aq_steel", desc = "Vẫn hoạt động trơn tru mặc dù bề mặt ngoài đã gỉ.\n\nMột bộ phận người không cần che giấu việc làm bẩn thỉu của mình" },
	["hy_hex"] = { name = "hy_hex", desc = "Được sơn nhúng họa tiết lục giác." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "Được sơn nhúng sử dụng họa tiết ngụy trang quá cỡ." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Được bọc bằng lớp tráng kim loại đánh họa tiết ngắt quãng điện tử." },
	["twigs"] = { name = "twigs", desc = "Được phun sơn bằng tay không sử dụng nhánh cây làm khuôn tô." },
	["varicamo"] = { name = "varicamo", desc = "Được sơn nhúng sử dụng họa tiết ngụy trang đa dụng.\n\nChỉ có thể xây dựng lại một khi đã bị hủy diệt" },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "Được rèn từ một thanh phôi kết hợp hai loại thép cacbon khác nhau.\n\nMãi mới có, một vũ khí đủ mạnh để xứng với quyết tâm của mình" },
	["am_crystallized"] = { name = "am_crystallized", desc = "Được chải bằng sơn kim loại, sử dụng lớp bọc kết tinh để tạo họa tiết.\n\nAi mà chả muốn gây ấn tượng" },
	["snakeskin"] = { name = "snakeskin", desc = "Được nhúng sơn họa tiết da rắn.\n\nTao biết mày không hề tin đại cục này...một khi tao vạch trần được mày, Valeria sẽ lấy đầu mày - Tấm khiên và con mãng xà , phần 1" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Được sơn màu xanh côban và biểu tượng CT ở trên ổ đạn.\n\nNghe này, chị mày đây có thể làm theo quy trình và cứu được 7, hoặc là theo cách của chị thì cứu toàn bộ 10... các người tự quyết định - Chuyên gia giải cứu Carmen Cocinero" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Được sơn nhúng họa tiết sọc vuông màu nâu sẫm và lục-lam.\n\nKhông phải kèn túi, nhưng mỗi lần vang lên là có đám ma" },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Được sơn tùy chỉnh họa tiết ngụy trang đô thị với tông màu đỏ.\n\nHàng năm, Booth vun lại những thợ súng đứng đầu thế giới đến để phô diễn thiết kế mới nhất của họ" },
	["an_emerald"] = { name = "an_emerald", desc = "Được sơn lớp crôm nền rồi tô điểm bằng hiệu ứng anode lục bảo trong suốt.\n\nSebastien Hennequet vĩ đại giờ chỉ còn thế này? Một bà giáo mè nheo? Ông bị làm sao vậy... - Người thầy và kẻ bất tuân, phần 2" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Từng phần được phun riêng một màu sơn theo tông lam và cam.\n\nĐào vàng kiểu Úc" },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Được tùy chỉnh kết hợp giữa sơn nhúng, khuôn tô cẩn thận và trang trí tỉ mỉ bằng đề can áp nhiệt.\n\nChase Turner là một người tài giỏi... anh sẽ cần làm nhiều để thế chỗ – Phượng hoàng và kẻ tập sự, phần 1" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Được khắc các bộ xương, hoa và những con mãng xà.\n\nVậy nên đã có Huxley lo mấy việc khó nhằn rồi, chúng ta chỉ việc đẩy cô ta đi tiếp... - Mãng xà và kẻ lần sự thật, phần 2" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Được sơn tùy chỉnh với thiết kế màu đỏ và xám hiện đại làm tôn dáng vóc của vũ khí.\n\nCùng nhau chúng ta luôn mạnh mẽ hơn" },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Được sơn tùy chỉnh hình một sinh vật quỷ dị với màu sắc gây ảo giác.\n\nHọ gọi ông là quỷ Oni, nhể? Cái tên nghe dễ sợ cho một kẻ đáng thương... – Lính đánh thuê Elliot Kingsman" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "Được sơn nhúng họa tiết ngụy trang màu lam." },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "Được sơn tùy chỉnh với thiết kế đen trắng rõ ràng và hoàn thiện với những điểm nhấn màu ngọc trai.\n\nTRẮNG_1; ĐEN_1; NGỌC TRAI_1; GIẢM THANH_1; PISTOL_1;" },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "It has been custom painted with a stark black and white design and finished with pearlescent highlights.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1;" },
